  `body` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст сообщения',
  `media_id` int unsigned DEFAULT NULL,
  `is_important` tinyint(1) DEFAULT NULL COMMENT 'Признак важности',
